void initM8()
{
    dimension = 8;
	makeMatrix();
	for(i=0; i<dimension; i++)
		for(j=0; j<dimension; j++)
			augmentedmatrix[i][j]=a8[i][j];
	augmentingmatrix();
}
void initM16()
{
    dimension = 16;
	makeMatrix();
	for(i=0; i<dimension; i++)
		for(j=0; j<dimension; j++)
			augmentedmatrix[i][j]=a16[i][j];
	augmentingmatrix();
}
void initM32()
{
    dimension = 32;
	makeMatrix();
	for(i=0; i<dimension; i++)
		for(j=0; j<dimension; j++)
			augmentedmatrix[i][j]=a32[i][j];
	augmentingmatrix();
}
void initM64()
{
    dimension = 64;
	makeMatrix();
	for(i=0; i<dimension; i++)
		for(j=0; j<dimension; j++)
			augmentedmatrix[i][j]=a64[i][j];
	augmentingmatrix();
}
void initM128()
{
    dimension = 128;
	makeMatrix();
	for(i=0; i<dimension; i++)
		for(j=0; j<dimension; j++)
			augmentedmatrix[i][j]=a128[i][j];
	augmentingmatrix();
}

void InvSMatM8()
{
    for(j=0; j<8; j++){
		findPivo();
		swapLine();
		calcInverse();
	}
}
void InvSMatM16()
{
    for(j=0; j<16; j++){
		findPivo();
		swapLine();
		calcInverse();
	}
}
void InvSMatM32()
{
    for(j=0; j<32; j++){
		findPivo();
		swapLine();
		calcInverse();
	}
}
void InvSMatM64()
{
    for(j=0; j<64; j++){
		findPivo();
		swapLine();
		calcInverse();
	}
}
void InvSMatM128()
{
    for(j=0; j<128; j++){
		findPivo();
		swapLine();
		calcInverse();
	}
}

/*Função main. Recebe como parametro a dimensão da matriz*/
int main()
{
    uint64_t begin;
    uint64_t end;
    uint64_t ans = 0;
    int i;

    printf("parallelMatrixInversion Method performance test:\n");
    initM8();
    begin = start_rdtsc();
    for (i = 0; i < TEST; i++)
    {
        InvSMatM8();
    }
    end = end_rdtsc();
    ans = (end - begin);
    printf("compute 8*8 inverse matrix cost %llu CPU cycles\n", (ans) / TEST);
    
    initM16();
    begin = start_rdtsc();
    for (i = 0; i < TEST; i++)
    {
        InvSMatM16();
    }
    end = end_rdtsc();
    ans = (end - begin);
    printf("compute 16*16 inverse matrix cost %llu CPU cycles\n", (ans) / TEST);

	initM32();
    begin = start_rdtsc();
    for (i = 0; i < TEST; i++)
    {
        InvSMatM32();
    }
    end = end_rdtsc();
    ans = (end - begin);
    printf("compute 32*32 inverse matrix cost %llu CPU cycles\n", (ans) / TEST);

	initM64();
    begin = start_rdtsc();
    for (i = 0; i < TEST; i++)
    {
        InvSMatM64();
    }
    end = end_rdtsc();
    ans = (end - begin);
    printf("compute 64*64 inverse matrix cost %llu CPU cycles\n", (ans) / TEST);

	initM128();
    begin = start_rdtsc();
    for (i = 0; i < TEST; i++)
    {
        InvSMatM128();
    }
    end = end_rdtsc();
    ans = (end - begin);
    printf("compute 128*128 inverse matrix cost %llu CPU cycles\n", (ans) / TEST);

    return 0;
}